    window.gapi.load('client', () => {
      console.log(gapi.client);
      gapi.client.init({
        'apiKey': 'AIzaSyCxmfmN_PBqgToKyKLQTwGGqurUkVrtx-o',
      });
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
